site_name: agents-monitor-mapping Documentation
site_description: Documentation for agents-monitor-mapping
docs_dir: mkdocs_src
site_dir: docs
theme:
  name: material
  palette:
  - scheme: default
    primary: indigo
    accent: indigo
  features:
  - navigation.expand
nav:
- Home: index.md
- API Reference:
  - Cli.Cli: api/cli.cli.md
  - Main: api/main.md
  - Parsers.Ocd County Extractor: api/parsers.ocd_county_extractor.md
  - Parsers.Ocd Parser: api/parsers.ocd_parser.md
plugins:
- search
markdown_extensions:
- toc
- codehilite
- admonition
